export const jwtToken = localStorage.getItem("authorization");

var Axios = require("axios");

Axios.interceptors.request.use(
    function(config) {
      if (jwtToken) {
        config.headers["authorization"] = jwtToken;
      }
      return config;
    },
    function(err) {
      return Promise.reject(err);
    }
  );
